export async function RetrieveApiData():Promise<Array<any>>{
    async function retrieveData(){
        const url:string = 'https://finnhub.io/api/v1/stock/symbol?exchange=US&token=bueubhn48v6tiubsufc0'
        return await fetch(url);
    }
    
    async function processRetrievedData(){
        let symbols:Array<any> = await retrieveData();
        let symbolObjects:Array<any> = [];
        symbols.forEach(el=>{
            symbolObjects.push({symbol:el.symbol,description:el.description});
        });
        return symbolObjects;
    }

    return await processRetrievedData();

}
